import React from "react";
import FooterComponent from "./components/Footer";
import HeaderComponent from "./components/header";

function App() {
  return (
    <div>
      <HeaderComponent></HeaderComponent>
      <FooterComponent></FooterComponent>
    </div>
  );
}

export default App;
